import React from 'react'

import s from './Cooperate.module.css'

const Cooperate = () => {
    return (
      <div className={s.container}>
        <div className={s.inner}>
          <p className={s.title}>Ваш университет сотрудничает с беларускими?</p>
          <p className={s.text}>
            Требуй организовать экстримальный студенческий обмен в Беларусь.<br /> Или
            подпиши петицию...
          </p>
        </div>
      </div>
    );
}

export default Cooperate
